import React from 'react';

const Skills = () => {
  return (
    <section id="yetenekler" className="section">
      <h2>Teknik Yetenekler</h2>
      <div className="skills-grid">
        <div className="skill-item">Javascript</div>
        <div className="skill-item">PL/SQL</div>
        <div className="skill-item">Agile/Scrum</div>
        <div className="skill-item">Oracle Database</div>
        <div className="skill-item">RESTful API</div>
        <div className="skill-item">Flutter/Dart</div>
        <div className="skill-item">Java</div>
        <div className="skill-item">Problem Solving</div>
      </div>
      
      <h3 style={{ marginTop: '2rem' }}>Diller</h3>
      <div className="skills-grid">
        <div className="skill-item">Türkçe</div>
        <div className="skill-item">İngilizce</div>
      </div>
    </section>
  );
};

export default Skills;
